var 随机数字=Math.ceil(Math.random()*88888+10000)


function 移动按钮(which,xx,yy,main,bool){
if(bool==null){bool=false}
var mX,mY
which.setOnTouchListener(new android.view.View.OnTouchListener({onTouch:function(v,e){
try{
switch(e.getAction()){
case 0:mX=e.getX();mY=e.getY();break;
case 1:break;
case 2:
var delX=parseInt(e.getX()-mX)*0.5;
var delY=parseInt(e.getY()-mY)*0.5;
xx+=delX;yy+=delY;
main.update(parseInt(xx),parseInt(yy),-1,-1);
break;}
return bool;
}catch(e){print(e)}
}})); 
return [which,main]
}
